import React from 'react';
import LineChartBox from '../components/LineChartBox';
import '../styles/MainPage.css';
import DataBox from '../components/DataBox';
import LineChart from '../components/LineChart';


const MainPage = () => {
  return (
    <div className="main-page">
      <h1>Main Page</h1>
      <div className="data-grid" style={{ display: 'flex', flexWrap: 'wrap' }}>
        <DataBox title="Data Point 1" value="100" />
        <DataBox title="Data Point 2" value="200" />
        <DataBox title="Data Point 3" value="300" />
        {/* Add more DataBox components as needed */}
      </div>
      <LineChart />
    </div>
  );
};

export default MainPage;
